#include<iostream>
#include<cstdlib>
using namespace std;
string nums = "";
long long n[20][20], x,y, output;
int main(){
    for(int i=0;i<800;i+=2){
        n[x][y]=atoi((nums.substr(i,2)).c_str());
        y+=1;
    }
    for(int i=0;i<20;i++){
        for(int j=0;j<20;j++){
            if(n[i][j]*n[i+1][j+1]*n[i+2][j+2]*n[i+3][j+3]>output && i<17 && j<17){
                output=n[i][j]*n[i+1][j+1]*n[i+2][j+2]*n[i+3][j+3];
            }
            if(n[i][j]*n[i-1][j+1]*n[i-2][j+2]*n[i-3][j+3]>output && i>2 && j<17){
                output=n[i][j]*n[i-1][j+1]*n[i-2][j+2]*n[i-3][j+3];
            }
            if(n[i][j]*n[i+1][j]*n[i+2][j]*n[i+3][j]>output && i<17){
                output=n[i][j]*n[i+1][j]*n[i+2][j]*n[i+3][j];
            }
            if(n[i][j]*n[i][j+1]*n[i][j+2]*n[i][j+3]>output && j<17){
                output=n[i][j]*n[i][j+1]*n[i][j+2]*n[i][j+3];
            }
        }
    }
    cout << output;
}
